import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as l,c as a,d as e}from"./app.a3d402e1.js";const r={},h=e('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u7ACB\u9879\u7BA1\u7406\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u9879\u76EE\u7ACB\u9879" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u7ACB\u9879" aria-hidden="true">#</a> \u9879\u76EE\u7ACB\u9879</h2><p>\u9879\u76EE\u7ACB\u9879\u4E00\u822C\u5305\u62EC\u63D0\u4EA4\u9879\u76EE\u5EFA\u8BAE\u4E66\u3001\u9879\u76EE\u53EF\u884C\u6027\u7814\u7A76\u3001\u9879\u76EE\u62DB\u6807\u4E0E\u6295\u6807\u7B49\u5185\u5BB9\u3002</p><h3 id="\u9879\u76EE\u5EFA\u8BAE\u4E66" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u5EFA\u8BAE\u4E66" aria-hidden="true">#</a> \u9879\u76EE\u5EFA\u8BAE\u4E66</h3><p>\u6838\u5FC3\u5185\u5BB9\u5305\u62EC\uFF1A</p><p>\uFF081\uFF09\u9879\u76EE\u7684\u5FC5\u8981\u6027 \uFF082\uFF09\u9879\u76EE\u7684\u5E02\u573A\u9884\u6D4B \uFF083\uFF09\u4EA7\u54C1\u65B9\u6848\u6216\u670D\u52A1\u7684\u5E02\u573A\u9884\u6D4B \uFF084\uFF09\u9879\u76EE\u5EFA\u8BBE\u5FC5\u9700\u7684\u6761\u4EF6</p><h3 id="\u9879\u76EE\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A" aria-hidden="true">#</a> \u9879\u76EE\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A</h3><p>\u53EF\u884C\u6027\u7814\u7A76\u7684\u5185\u5BB9\uFF1A</p><ul><li>\u6295\u8D44\u5FC5\u8981\u6027</li><li>\u6280\u672F\u53EF\u884C\u6027\u5206\u6790 =&gt; \u9700\u8981\u8003\u8651\u7684\u56E0\u7D20 <ul><li>\u8FDB\u884C\u9879\u76EE\u5F00\u53D1\u7684\u98CE\u9669</li><li>\u4EBA\u529B\u8D44\u6E90\u7684\u6709\u6548\u6027</li><li>\u6280\u672F\u80FD\u529B\u7684\u53EF\u80FD\u6027</li><li>\u7269\u8D28\uFF08\u4EA7\u54C1\u7684\u53EF\u7528\u6027\uFF09</li></ul></li><li>\u8D22\u52A1\u53EF\u884C\u6027</li><li>\u7EC4\u7EC7\u53EF\u884C\u6027</li><li>\u7ECF\u6D4E\u53EF\u884C\u6027 =&gt; \u652F\u51FA\u5206\u6790\u3001\u6536\u76CA\u5206\u6790\u3001\u6295\u8D44\u56DE\u62A5\u5206\u6790\u4EE5\u53CA\u654F\u611F\u6027\u5206\u6790, \u5305\u542B\u5BF9\u9879\u76EE\u7684\u7684\u793E\u4F1A\u6548\u76CA\u5206\u6790</li><li>\u793E\u4F1A\u53EF\u884C\u6027</li><li>\u98CE\u9669\u56E0\u7D20\u53CA\u5BF9\u7B56</li></ul><p>\u53EF\u884C\u6027\u7814\u7A76\u5206\u4E3A\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76\u3001\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u3001\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A\u4E09\u4E2A\u57FA\u672C\u9636\u6BB5, \u6B65\u9AA4\uFF1A</p><ol><li>\u786E\u5B9A\u9879\u76EE\u89C4\u6A21\u548C\u76EE\u6807</li><li>\u7814\u7A76\u6B63\u5728\u8FD0\u884C\u7684\u7CFB\u7EDF</li><li>\u5EFA\u7ACB\u65B0\u7CFB\u7EDF\u7684\u903B\u8F91\u6A21\u578B</li><li>\u5BFC\u51FA\u548C\u8BC4\u4EF7\u5404\u79CD\u65B9\u6848</li><li>\u63A8\u8350\u53EF\u884C\u6027\u65B9\u6848</li><li>\u7F16\u5199\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A</li><li>\u9012\u4EA4\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A</li></ol><h2 id="\u53EF\u884C\u6027\u7814\u7A76" tabindex="-1"><a class="header-anchor" href="#\u53EF\u884C\u6027\u7814\u7A76" aria-hidden="true">#</a> \u53EF\u884C\u6027\u7814\u7A76</h2><p>\u673A\u4F1A\u7814\u7A76\u3001\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76\u3001\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u3001\u8BC4\u4F30\u4E0E\u51B3\u7B56\u662F\u6295\u8D44\u524D\u671F\u56DB\u4E2A\u9636\u6BB5\u3002\u5176\u4E2D\u524D\u4E09\u4E2A\u53EF\u4EE5\u8FDB\u884C\u5408\u5E76, \u4F46\u662F\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u662F\u4E0D\u53EF\u6216\u7F3A\u7684\u3002\u53EF\u4EE5\u8FDB\u884C\u7701\u7565\u7684\u9636\u6BB5\u6709\u673A\u4F1A\u7814\u7A76\u3001\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76\u3002</p><h3 id="\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76" tabindex="-1"><a class="header-anchor" href="#\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76" aria-hidden="true">#</a> \u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76</h3><p>\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76\u4E00\u822C\u662F\u5728\u5BF9\u5E02\u573A\u6216\u8005\u5BA2\u6237\u60C5\u51B5\u8FDB\u884C\u8C03\u67E5\u540E, \u5BF9\u9879\u76EE\u8FDB\u884C\u7684\u521D\u6B65\u8BC4\u4F30</p><h3 id="\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76" tabindex="-1"><a class="header-anchor" href="#\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76" aria-hidden="true">#</a> \u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76</h3><p>\u9700\u8981\u5BF9\u9879\u76EE\u5728\u6280\u672F\u3001\u7ECF\u6D4E\u3001\u793E\u4F1A\u3001\u8FD0\u884C\u73AF\u5883\u3001\u6CD5\u5F8B\u7B49\u65B9\u9762\u8FDB\u884C\u6DF1\u5165\u7684\u8C03\u67E5\u7814\u7A76\u548C\u5206\u6790, \u662F\u4E00\u9879\u8D39\u65F6\u3001\u8D39\u529B\u7684\u5DE5\u4F5C, \u7279\u522B\u662F\u5927\u578B\u7684\u6216\u6BD4\u8F83\u590D\u6742\u7684\u9879\u76EE\u66F4\u662F\u5982\u6B64</p><p>\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u7684\u57FA\u672C\u539F\u5219</p><p>\uFF081\uFF09\u79D1\u5B66\u6027\u539F\u5219 \uFF082\uFF09\u5BA2\u89C2\u6027\u539F\u5219 \uFF083\uFF09\u516C\u6B63\u6027\u539F\u5219</p><p>\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u7684\u5185\u5BB9</p><p>\uFF081\uFF09\u6982\u8FF0 \uFF082\uFF09\u9700\u6C42\u786E\u5B9A \uFF083\uFF09\u73B0\u6709\u8D44\u6E90\u3001\u8BBE\u65BD\u60C5\u51B5\u5206\u6790 \uFF084\uFF09\u8BBE\u8BA1\uFF08\u521D\u6B65\uFF09\u6280\u672F\u65B9\u6848 \uFF085\uFF09\u9879\u76EE\u5B9E\u65BD\u8FDB\u5EA6\u8BA1\u5212\u5EFA\u8BAE \uFF086\uFF09\u6295\u8D44\u4F30\u7B97\u548C\u8D44\u91D1\u7B79\u63AA\u8BA1\u5212 \uFF087\uFF09\u9879\u76EE\u7EC4\u7EC7\u3001\u4EBA\u529B\u8D44\u6E90\u3001\u6280\u672F\u57F9\u8BAD\u8BA1\u5212 \uFF088\uFF09\u7ECF\u6D4E\u548C\u793E\u4F1A\u6548\u76CA\u5206\u6790 \uFF089\uFF09\u5408\u4F5C/\u534F\u4F5C\u65B9\u5F0F</p><p>\u5F00\u53D1\u603B\u6210\u672C\u4E00\u822C\u5212\u5206\u4E3A\u56DB\u5927\u7C7B\uFF1A\u7814\u53D1\u6210\u672C\u3001\u884C\u653F\u7BA1\u7406\u8D39\u3001\u9500\u552E\u4E0E\u5206\u9500\u8D39\u7528\u3001\u8D22\u52A1\u8D39\u7528\u548C\u6298\u65E7, \u524D\u4E09\u7C7B\u6210\u672C\u7684\u603B\u548C\u79F0\u4E3A\u7ECF\u8425\u6210\u672C</p><h2 id="\u9879\u76EE\u8BC4\u4F30\u4E0E\u8BBA\u8BC1" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u8BC4\u4F30\u4E0E\u8BBA\u8BC1" aria-hidden="true">#</a> \u9879\u76EE\u8BC4\u4F30\u4E0E\u8BBA\u8BC1</h2><p>\u201C\u5148\u8BBA\u8BC1, \u540E\u8BC4\u4F30\u201D\u662F\u73B0\u4EE3\u9879\u76EE\u7BA1\u7406\u7684\u57FA\u672C\u539F\u5219\u3002</p><h3 id="\u9879\u76EE\u8BBA\u8BC1" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u8BBA\u8BC1" aria-hidden="true">#</a> \u9879\u76EE\u8BBA\u8BC1</h3><p>\u9879\u76EE\u8BBA\u8BC1\u662F\u4E00\u4E2A\u8FDE\u7EED\u7684\u8FC7\u7A0B, \u5E94\u8BE5\u56F4\u7ED5\u7740\u5E02\u573A\u9700\u6C42\u3001\u5F00\u53D1\u6280\u672F\u3001\u8D22\u52A1\u7ECF\u6D4E\u4E09\u4E2A\u65B9\u9762\u5C55\u5F00\u8C03\u67E5\u548C\u5206\u6790, \u5E02\u573A\u662F\u524D\u63D0\u3001\u6280\u672F\u662F\u624B\u6BB5\u3001\u8D22\u52A1\u7ECF\u6D4E\u662F\u6838\u5FC3</p><p>\u9879\u76EE\u8BBA\u8BC1\u4E00\u822C\u5206\u4E3A\u673A\u4F1A\u7814\u7A76\u3001\u521D\u6B65\u53EF\u884C\u6027\u7814\u7A76\u548C\u8BE6\u7EC6\u53EF\u884C\u6027\u7814\u7A76\u4E09\u4E2A\u9636\u6BB5</p><p>\u9879\u76EE\u8BBA\u8BC1\u6B65\u9AA4</p><ol><li>\u660E\u786E\u9879\u76EE\u8303\u56F4\u548C\u4E1A\u4E3B\u76EE\u6807</li><li>\u6536\u96C6\u5E76\u5206\u6790\u76F8\u5173\u8D44\u6599</li><li>\u62DF\u5B9A\u591A\u79CD\u53EF\u884C\u7684\u80FD\u591F\u76F8\u4E92\u66FF\u4EE3\u7684\u5B9E\u65BD\u65B9\u6848</li><li>\u591A\u65B9\u6848\u5206\u6790\u3001\u6BD4\u8F83</li><li>\u9009\u62E9\u6700\u4F18\u65B9\u6848\u8FDB\u4E00\u6B65\u8BE6\u7EC6\u5168\u9762\u5730\u8BBA\u8BC1</li><li>\u7F16\u5236\u9879\u76EE\u8BBA\u8BC1\u62A5\u544A\u3001\u73AF\u5883\u5F71\u54CD\u62A5\u544A\u4E66\u548C\u91C7\u8D2D\u65B9\u5F0F\u5BA1\u6279\u62A5\u544A</li><li>\u7F16\u5236\u8D44\u91D1\u7B79\u63AA\u8BA1\u5212\u548C\u9879\u76EE\u5B9E\u65BD\u8FDB\u5EA6\u8BA1\u5212</li></ol><h3 id="\u9879\u76EE\u8BC4\u4F30" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u8BC4\u4F30" aria-hidden="true">#</a> \u9879\u76EE\u8BC4\u4F30</h3><p>\u8F93\u51FA\u6587\u4EF6\uFF1A\u9879\u76EE\u8BC4\u4F30\u62A5\u544A</p><p>\u9879\u76EE\u8BC4\u4F30\u7684\u4F9D\u636E\uFF1A</p><ol><li>\u9879\u76EE\u5EFA\u8BAE\u4E66\u53CA\u5176\u6279\u51C6\u6587\u4EF6</li><li>\u9879\u76EE\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A</li><li>\u62A5\u9001\u5355\u4F4D\u7684\u7533\u8BF7\u62A5\u544A\u53CA\u4E3B\u7BA1\u90E8\u95E8\u7684\u521D\u5BA1\u610F\u89C1</li><li>\u6709\u5173\u8D44\u6E90\u3001\u914D\u4EF6\u3001\u71C3\u6599\u3001\u6C34\u3001\u7535\u3001\u4EA4\u901A\u3001\u901A\u4FE1\u3001\u8D44\u91D1\uFF08\u5305\u62EC\u5916\u6C47\uFF09\u7B49\u65B9\u9762\u7684\u534F\u8BAE\u6587\u4EF6</li><li>\u5FC5\u9700\u7684\u5176\u4ED6\u6587\u4EF6\u548C\u8D44\u6599</li></ol><p>\u9879\u76EE\u8BC4\u4F30\u5DE5\u4F5C</p><ol><li>\u6210\u7ACB\u8BC4\u4F30\u5C0F\u7EC4, \u8FDB\u884C\u5206\u5DE5\u3001\u5236\u5B9A\u8BC4\u4F30 \u5DE5\u4F5C\u8BA1\u5212</li><li>\u5F00\u5C55\u8C03\u67E5\u7814\u7A76, \u6536\u96C6\u6570\u636E\u8D44\u6599, \u5E76\u5BF9\u53EF\u884C\u6027\u7814\u7A76\u62A5\u544A\u548C\u76F8\u5173\u8D44\u6599\u8FDB\u884C\u5BA1\u67E5\u548C\u5206\u6790</li><li>\u5206\u6790\u4E0E\u8BC4\u4F30</li><li>\u7F16\u5199\u8BC4\u4F30\u62A5\u544A</li><li>\u8BA8\u8BBA\u3001\u4FEE\u6539\u62A5\u544A</li><li>\u4E13\u5BB6\u8BBA\u8BC1\u4F1A</li><li>\u8BC4\u4F30\u62A5\u544A\u5B9A\u7A3F</li></ol>',35),p=[h];function d(t,n){return l(),a("div",null,p)}var s=i(r,[["render",d],["__file","project-approval.html.vue"]]);export{s as default};
